import React from 'react';
import styled from 'styled-components/native';
import '../assets/Intro.css'

const Position = styled.View`
    display: flex;
    flex-direction: column;
    position: fixed;
    top: 0px;
    width: 100%;
`;

const GrayBackground = styled.View`
    background: white;
    display: flex;
    justify-content: center;
    align-items:center;
    height: auto;
`;

const HeaderContents = styled.View`
    width: 100%;
    height: 100px;
    display: flex;
    flex-direction: row;
    align-items: center;

    padding-right: 1rem;
    padding-left: 1rem;
`;

const Logo = styled.View`
    font-size: 80px;
    font-weigth:bold;
    letter-spacing: 2px;
    font-family: 'title-font';
`;
const Spacer = styled.View`
    flex-grow: 1;
`;

const Introheader = ({props}) => {
    return(
        <Position>
            <GrayBackground>
                <HeaderContents>
                    <Logo><a href="/"> 술고래 </a></Logo>
                    <Spacer/>

               </HeaderContents>
            </GrayBackground>
        </Position>
    );
}

export default Introheader;
